import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container">
      <h1>Codepolitan DevSchool</h1>
      <div className="col-md-6" style={{ border: '1px solid black' }}>
        <h2>Member</h2>
      </div>
      <div className="col-md-6" style={{ border: '1px solid black' }}>
        <h2>Form</h2>
      </div>
    </div>
  );
}

export default App;
